function Plus(){
    const [counter,setCounter]=useState(0);
    const plu=()=>{
        let c=counter;
        c++;
        setCounter(c)
    }


    return(
        <div>
            <input type="button" value="+" onClick={plu} />
            <input type="button" value="+" onClick={plu} />
            <input type="button" value="+" onClick={plu} />
            
        </div>
    );
}
export default Plus
